void init_video() {
    //设置分辨率为320*240（学校硬件如此）
    vp->resolution = (HEIGHT << 16) | WIDTH;
    // Initialize back buffer to our allocated array
    vp->bfbp = (struct fb_t volatile *)backbuffer.pixels;
}

void clear_screen() {
    switch(current_level){
        case 0:
            for (int y = 0; y < HEIGHT; y++) {
                for (int x = 0; x < WIDTH; x++) {
                    vp->bfbp->pixels[y][x] = level.title_screen[y][x];
                }
            }
            break;
        case 1:
            for (int y = 0; y < HEIGHT; y++) {
                for (int x = 0; x < WIDTH; x++) {
                    vp->bfbp->pixels[y][x] = level.level_1[y][x];
                }
            }
            break;
        default: 
            for (int y = 0; y < HEIGHT; y++) {
                for (int x = 0; x < WIDTH; x++) {
                    vp->bfbp->pixels[y][x] = level.level_1[y][x];
                }
            }
    }
    
}

void draw_start_screen() {
    clear_screen();
    //绘制玩家位置
    draw_character(&slugfox);
    write_hex(current_level);
    swap_buffers();
}

void draw_init_level() {
    clear_screen();
    draw_trigger(&trigger_pos[current_level]);
    draw_character(&slugfox);
    for (int i = 0; i < 5; i++) {
        if (trains[i].active) draw_train(&trains[i]);
    }
    for (int y = 0; y < HEIGHT; y++) {
        for (int x = 0; x < WIDTH; x++) {
            pixel_rgb_t pixel = level.level_1_front[y][x];
            // Skip pixels that are near white (within tolerance of WHITE) or pure black
            if (pixel.r == CYAN.r &&
                pixel.g == CYAN.g &&
                pixel.b == CYAN.b) {
                continue;
            }
            vp->bfbp->pixels[y][x] = pixel;
        }
    }
    write_hex(current_level);
    swap_buffers();
}

