#include <stdlib.h>  // For abs()

void draw_character(Slugfox *slugfox) {
    int x = slugfox->chara_pos.x;
    int y = slugfox->chara_pos.y;
    int h = slugfox->h;
    int w = slugfox->w;
    int frame_duration = 5;
    int anim_frame = (frame_counter / frame_duration) % 4;
    if (horizontal_velocity_clone != 0){
        w = 40;
        h = 45;
        anim_frame = (frame_counter / frame_duration) % 3;
    } //奔跑状态
    pixel_rgb_t (*sprite)[h][w];


    
    if (horizontal_velocity_clone == 0) {
        if (slugfox->face_dir == 1) {  // Facing right
            switch (anim_frame) {
                case 0:
                    sprite = &slugfox->static_right_1;
                    break;
                case 1:
                    sprite = &slugfox->static_right_2;
                    break;
                case 2:
                    sprite = &slugfox->static_right_3;
                    break;
                case 3:
                    sprite = &slugfox->static_right_2;
                    break;
                default:
                    sprite = &slugfox->static_right_1;
            }
        } else {  // Facing left
            switch (anim_frame) {
                case 0:
                    sprite = &slugfox->static_left_1;
                    break;
                case 1:
                    sprite = &slugfox->static_left_2;
                    break;
                case 2:
                    sprite = &slugfox->static_left_3;
                    break;
                case 3:
                    sprite = &slugfox->static_left_2;
                    break;
                default:
                    sprite = &slugfox->static_left_1;
            }
        }
    } else { //奔跑中
        if (slugfox->face_dir == 1) {  // Facing right
            switch (anim_frame) {
                case 0:
                    sprite = &slugfox->move_right_1;
                    break;
                case 1:
                    sprite = &slugfox->move_right_2;
                    break;
                case 2:
                    sprite = &slugfox->move_right_3;
                    break;
                default:
                    sprite = &slugfox->move_right_1;
            }
        } else {  // Facing left
            switch (anim_frame) {
                case 0:
                    sprite = &slugfox->move_left_1;
                    break;
                case 1:
                    sprite = &slugfox->move_left_2;
                    break;
                case 2:
                    sprite = &slugfox->move_left_3;
                    break;
                case 3:
                    sprite = &slugfox->move_left_2;
                    break;
                default:
                    sprite = &slugfox->move_left_1;
            }
        }
    }
    

    // Tolerance for detecting near-PURPLE
    const int tolerance = 2;

    for (int dy = 0; dy < h; dy++) {
        for (int dx = 0; dx < w; dx++) {
            int px = x + dx;
            int py = y + dy;
            pixel_rgb_t pixel = (*sprite)[dy][dx];
            if ((abs(pixel.r - PURPLE.r) <= tolerance &&
                 abs(pixel.g - PURPLE.g) <= tolerance &&
                 abs(pixel.b - PURPLE.b) <= tolerance)) {
                continue;
            }
            if (horizontal_velocity_clone == 0){
                vp->bfbp->pixels[py][px] = pixel;
            } else { //防止角色和地面穿模
                vp->bfbp->pixels[py-3][px] = pixel;
            }
            
        }
    }
}


void draw_trigger(Position *trigg_pos) {
    // 5x5 red square for trigger (only for levels 1-9)
    if (current_level > 0 && current_level <= 10) {
        int tx = trigg_pos->x;
        int ty = trigg_pos->y;
        for (int dy = 0; dy < 5; dy++) {
            for (int dx = 0; dx < 5; dx++) {
                int px = tx + dx;
                int py = ty + dy;
                if (px >= 0 && px < WIDTH && py >= 0 && py < HEIGHT) {
                    vp->bfbp->pixels[py][px] = RED;
                }
            }
        }
    }
}

void trigger_collision(Position *chara_pos) {
    int chara_left = chara_pos->x;
    if (horizontal_velocity_clone > 0) {chara_left = chara_left + 10;}//在向右跑时，让碰撞箱右移10像素
    int chara_right = chara_pos->x + slugfox.w;
    if (horizontal_velocity_clone > 0) {chara_right = chara_right + 10;}//在向右跑时，让碰撞箱右移10像素
    int chara_top = chara_pos->y;
    int chara_bottom = chara_pos->y + slugfox.h;

    int trigger_left = trigger_pos[current_level].x;
    int trigger_right = trigger_pos[current_level].x + 5;
    int trigger_top = trigger_pos[current_level].y;
    int trigger_bottom = trigger_pos[current_level].y + 5;

    if (chara_right >= trigger_left && chara_left <= trigger_right &&
        chara_bottom >= trigger_top && chara_top <= trigger_bottom) {
        current_level++;
        if (current_level > 10) {current_level = 10;}
        //将玩家位置重设为关卡开始点
        *chara_pos = init_pos[current_level];
        draw_init_level(current_level);  // Redraw new level
        write_hex(current_level);    
    }
}

#define NUM_PLATFORMS 6

typedef struct {
    int x;
    int y;
	int length;
} Platform;

// Example platforms: each platform spans from x to x+10 at a fixed y.
Platform platforms[NUM_PLATFORMS] = {
    {70, 140, 50},
	{150, 150, 20},
    {70, 95, 50},
	{150, 80, 20},
    {220, 165, 50},
	{220, 80, 50},
	
};

// Helper function to check if the character is exactly standing on any platform
int on_platform(Position *chara_pos) {
    for (int i = 0; i < NUM_PLATFORMS; i++) {
        if (chara_pos->x + slugfox.w > platforms[i].x &&
            chara_pos->x < platforms[i].x + platforms[i].length) {
            if (chara_pos->y + slugfox.h == platforms[i].y) {
                return 1;
            }
        }
    }
    return 0;
}

void update_character_movement(Position *chara_pos) {
    int switches = read_switches();
    // 使用静态变量保存各个键的状态
    static int w_pressed = 0, a_pressed = 0, s_pressed = 0, d_pressed = 0;
    int PS2_data, RVALID;
    unsigned char code;
    static int break_detected = 0;  // 标记是否检测到Break码

    // 从FIFO读取所有数据更新按键状态
    while (1) {
        PS2_data = *(PS2_ptr);
        RVALID = (PS2_data & 0x8000);
        if (!RVALID) {
            break;
        }
        code = PS2_data & 0xFF;
        if (code == 0xF0) {  // Break码标记
            break_detected = 1;
            continue;
        }
        if (break_detected) {
            // 根据释放的键更新状态
            switch (code) {
                case 0x1D: w_pressed = 0; break;
                case 0x1B: s_pressed = 0; break;
                case 0x1C: a_pressed = 0; break;
                case 0x23: d_pressed = 0; break;
                default: break;
            }
            break_detected = 0;
        } else {
            // 按下状态
            switch (code) {
                case 0x1D: w_pressed = 1; break;
                case 0x1B: s_pressed = 1; break;
                case 0x1C: a_pressed = 1; break;
                case 0x23: d_pressed = 1; break;
                default: break;
            }
        }
    }

    // 根据a_pressed和d_pressed设置水平速度克隆（供动画使用）
    if (a_pressed && !d_pressed) {
        horizontal_velocity_clone = -3;
    } else if (d_pressed && !a_pressed) {
        horizontal_velocity_clone = 3;
    } else {
        horizontal_velocity_clone = 0;
    }

    // 边界检测
    if (chara_pos->x <= 0) {
        chara_pos->x = 0;
        horizontal_velocity = 0;
    }
    if (chara_pos->x + slugfox.w >= WIDTH) {
        chara_pos->x = WIDTH - slugfox.w;
        horizontal_velocity = 0;
    }

    // 地面上允许左右移动（非跳跃状态）
    if (!is_jumping) {
        if (a_pressed && chara_pos->x > 0) {
            chara_pos->x -= 5;
            slugfox.face_dir = 0;
        }
        if (d_pressed && chara_pos->x + slugfox.w < WIDTH) {
            chara_pos->x += 5;
            slugfox.face_dir = 1;
        }
    }

    // 跳跃触发（允许在地面或平台上跳跃）
    if (w_pressed && !is_jumping &&
        ((chara_pos->y + slugfox.h >= GROUND_LEVEL) || on_platform(chara_pos))) {
        vertical_velocity = jump_initial_velocity;
        is_jumping = 1;
        if (a_pressed && !d_pressed) {
            horizontal_velocity = -5;
            slugfox.face_dir = 0;
        } else if (d_pressed && !a_pressed) {
            horizontal_velocity = 5;
            slugfox.face_dir = 1;
        } else {
            horizontal_velocity = 0;
        }
    }

    // S键：向下移动
    if (s_pressed && !is_jumping && (chara_pos->y + slugfox.h < HEIGHT)) {
        chara_pos->y += 3;
    }

    // 如果不在地面或平台上，则开始下落
    if (!is_jumping && (chara_pos->y + slugfox.h < GROUND_LEVEL) && !on_platform(chara_pos)) {
        is_jumping = 1;
        vertical_velocity = 0;
    }

    // 应用重力和跳跃物理
    if (is_jumping) {
        // 空中时，应用固定水平速度（跳跃开始时捕获）
        chara_pos->x += horizontal_velocity;
        int new_y = chara_pos->y + vertical_velocity;
        int landed = 0;
        // 检查是否与平台碰撞
        for (int i = 0; i < NUM_PLATFORMS; i++) {
            if (chara_pos->x + slugfox.w > platforms[i].x &&
                chara_pos->x < platforms[i].x + platforms[i].length) {
                if (vertical_velocity >= 0 &&
                    chara_pos->y + slugfox.h <= platforms[i].y &&
                    new_y + slugfox.h >= platforms[i].y) {
                    chara_pos->y = platforms[i].y - slugfox.h;
                    vertical_velocity = 0;
                    horizontal_velocity = 0;
                    is_jumping = 0;
                    landed = 1;
                    break;
                }
            }
        }
        if (!landed) {
            if (new_y + slugfox.h >= GROUND_LEVEL) {
                chara_pos->y = GROUND_LEVEL - slugfox.h;
                vertical_velocity = 0;
                horizontal_velocity = 0;
                is_jumping = 0;
            } else {
                chara_pos->y = new_y;
                vertical_velocity += gravity;
            }
        }
    }
}

void draw_platforms(void) {
    for (int i = 0; i < NUM_PLATFORMS; i++) {
        int px = platforms[i].x;
        int py = platforms[i].y;
        // Draw a 10x3 rectangle for the platform
        for (int dx = 0; dx < platforms[i].length; dx++) {
            for (int dy = 0; dy < 3; dy++) {
                int x = px + dx;
                int y = py + dy;
                if (x >= 0 && x < WIDTH && y >= 0 && y < HEIGHT) {
                    vp->bfbp->pixels[y][x] = PURPLE;
                }
            }
        }
    }
}



//==============================
//====== 火车从这里开始 =========
//==============================

void train_gen(){
    if (current_level > 0) {  // Only generate for levels 1-10
        for (int i = 0; i < 5; i++) {
            trains[i] = level_trains[current_level-1].trains[i];
        }
    }
}

int train_collision(const Position *chara_pos) {
    int chara_left = chara_pos->x;
    if (horizontal_velocity_clone > 0) {chara_left = chara_left + 10;}//在向右跑时，让碰撞箱右移10像素
    int chara_right = chara_pos->x + slugfox.w;
    if (horizontal_velocity_clone > 0) {chara_right = chara_right + 10;}//在向右跑时，让碰撞箱右移10像素
    int chara_top = chara_pos->y;
    int chara_bottom = chara_pos->y + slugfox.h;

    for (int i = 0; i < 5; i++) {
        if (trains[i].active) {
            int train_left = trains[i].pos.x;
            int train_right = trains[i].pos.x + trains[i].w;
            int train_top = trains[i].pos.y;
            int train_bottom = trains[i].pos.y + trains[i].h;
            if (trains[i].h == 9) { //对于烟雾让它的hitbox稍微小点
                train_left++;
                train_right--;
                train_top++;
                train_bottom--;
            }

            if (chara_right >= train_left && chara_left <= train_right &&
                chara_bottom >= train_top && chara_top <= train_bottom) {
                return 1;  // Collision detected
            }
        }
    }
    return 0;  // No collision
}

void update_train(Train *train) {
    if (train->active) {
        train->pos.x += train->hor_speed;
        train->pos.y += train->ver_speed;
        if (train->pos.x <= 0) {
            train->pos.x = 0;
            train->hor_speed = -train->hor_speed;
        }
        else if (train->pos.x + train->w >= WIDTH) {
            train->pos.x = WIDTH - train->w;
            train->hor_speed = -train->hor_speed;
        }
        if (train->pos.y <= 0) {
            train->pos.y = 0;
            train->ver_speed = -train->ver_speed;
        }
        else if (train->pos.y + train->h >= HEIGHT) {
            train->pos.y = HEIGHT - train->h;
            train->ver_speed = -train->ver_speed;
        }
    }
}
void draw_train(const Train *train) {
    if (train->active) {
        int x = train->pos.x;
        int y = train->pos.y;
        for (int dy = 0; dy < train->h; dy++) {
            for (int dx = 0; dx < train->w; dx++) {
                int px = x + dx;
                int py = y + dy;
                if (px >= 0 && px < WIDTH && py >= 0 && py < HEIGHT) {
                    pixel_rgb_t pixel;
                    if (train->h == 10) { //表明画的是横向的火车
                        pixel = level.train_hor[dy][dx];
                        if ( pixel.r == WHITE.r &&
                            pixel.g == WHITE.g &&
                            pixel.b == WHITE.b ) {
                            continue;
                        }
                    } else if (train->h == 9) { //表明画的是竖向的毒气
                        pixel = level.train_ver[dy][dx];
                        const int tolerance = 6;
                        if ((abs(pixel.r - PURPLE.r) <= tolerance &&
                            abs(pixel.g - PURPLE.g) <= tolerance &&
                            abs(pixel.b - PURPLE.b) <= tolerance)) {
                        continue;
                        }
                    }
                    vp->bfbp->pixels[py][px] = pixel;
                    
                }
            }
        }
    }
}

//==============================
//====== 全部功能大总和 =========
//==============================

void swap_buffers() {
    vp->fbp = 1;  // Request swap
    while ((vp->StatusControl & 1) != 0);  // Wait for swap to complete
}

void update_frame_counter() {
    frame_counter++;
}

//无论如何都要保持每帧刷新屏幕，这是因为后面会加入动画
void redraw_frame(const Position *chara_pos) {
    // Draw background
    clear_screen();
    for (int i = 0; i < 5; i++) {
        if (trains[i].active) draw_train(&trains[i]);
    }
	// Draw platforms
    draw_platforms();

    update_frame_counter();  // Must be called here
    if (current_level == 1) {
        for (int y = 0; y < HEIGHT; y++) {
            for (int x = 0; x < WIDTH; x++) {
                pixel_rgb_t pixel = level.level_1_front[y][x];
                // Skip pixels that are near white (within tolerance of WHITE) or pure black
                if (pixel.r == CYAN.r &&
                    pixel.g == CYAN.g &&
                    pixel.b == CYAN.b) {
                    continue;
                }
                vp->bfbp->pixels[y][x] = pixel;
            }
        }
    }   
    draw_character(&slugfox);
     // Draw all elements in order
    if (current_level > 0) {
        draw_trigger(&trigger_pos[current_level]);
    }

    
    
    swap_buffers();  // Swap only once per frame
}


	